import React from 'react';
import cls from './home.module.scss'
import {Link} from "react-router-dom";

const Home = () => {
    return (
        <div className={cls.home}>
            <div className="container">
                <div>
                    <a className={cls.link} href="#">
                        <span></span>
                    </a>
                </div>
            </div>
        </div>
    );
};

export default Home;
